import React from 'react';
import { useState } from 'react';

 export default function LoginAuthPage(){
    const [disp, setDisp] = useState('none')
    function loginAppear(){
        disp == 'none ' ? setDisp=='flex': setDisp='none'
    }

    return(
        <>
            <div className='login-auth-detail-container' style={{display:disp}} onClick={loginAppear()}>
                hello baby
            </div>
        </>
        
    );
 }
